) +\n","tdn_theme+\n","  labs(title = \"Deconstructing vs Content Christian's Sex\",\n","              caption = \"Data source: The Deconstruction Network 2020\",\n","              x = \"\", y = \"\")+\n","percent_y+\n","grid_y+\n","space_leg+\n","colors_2"]},{"cell_type":"markdown","id":"38441855","metadata":{"papermill":{"duration":0.040633,"end_time":"2022-09-16T12:38:06.533202","exception":false,"start_time":"2022-09-16T12:38:06.492569","status":"completed"},"tags":[]},"source":["#### Findings regarding sex\n","**Finding 1: Deconstructing Christians are much more likely to be female (69%). Despite the Christian church on the whole being fairly close to 50/50.**\n","As we can see there is a significant difference in the makeup of our control and deconstructing group. The results are for the control group are about in line with what we would expect. Pew Research estimates that the average (Evanglical) Christian population globally is around 46% male, 54% female, our sample is 48.6% / 51.4% when adjusted for the one person who refused the question.\n"," \n","However in the deconstructing group 68% answered female a jump in 17 percentage points.\n","\n","We are fairly confident that the percentage makeup of the deconstructing group reflects the general community fairly well as candidates were collected from across the community via various podcasts and instagram influencers focusing on the issue.\n","\n","**Finding 2: There is not enough participation in our study from people who identify as non-binary.**\n","\n","While this is a very important subset of the population, unfortunately any use of this data to make statements about this group of people would only likely create misinformation.\n","\n","For this reason we will have to, within the scope of this study, focus solely on those who identify as either male or female when discussing matters relating to sex. However we will obviously still include their relevant information in other metrics where sex is not explo