on they come from.**\n","\n","Mean ages, even when trimmed for outliers, are significantly different. Our deconstructing group being around 10yrs younger on average. When comparing the age distribution of our control and deconstructing group with the rest of the Christian population ( see Pew Research Center's Religious Landscapes study ) we can see that, while the control group seems to fall well within a normal distribution of age, the deconstructing group skews much younger with only 15% being 50 or over."]},{"cell_type":"markdown","id":"9890bebe","metadata":{"papermill":{"duration":0.04412,"end_time":"2022-09-16T12:38:08.338199","exception":false,"start_time":"2022-09-16T12:38:08.294079","status":"completed"},"tags":[]},"source":["### RFDS Stats\n","\n","Initally we want to look at what sort of ranges we are looking at across the two groups regarding their RFDS score. This should be interesting as it has been shown across a few studies that those in conventional faith groups usually score in the low 40s.\n"]},{"cell_type":"code","execution_count":24,"id":"f9de0d11","metadata":{"execution":{"iopub.execute_input":"2022-09-16T12:38:08.429489Z","iopub.status.busy":"2022-09-16T12:38:08.427824Z","iopub.status.idle":"2022-09-16T12:38:08.46258Z","shell.execute_reply":"2022-09-16T12:38:08.460655Z"},"papermill":{"duration":0.083243,"end_time":"2022-09-16T12:38:08.464987","exception":false,"start_time":"2022-09-16T12:38:08.381744","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 6 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>header_rfds_stats</th><th scope=col>control_rfds_stats</th><th scope=col>deconst_rfds_stats</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>Min               </td><td>23.000000</td><td>28.000000</td></tr>\n","\t<tr><td>Mean              </td><td>43.868421</td><td>54.2690