abs(title = \"RFDS Scores by Age Group\",\n","       subtitle = 'note: 1 outlier has been removed from graph for clarity',\n","       caption = \"Data source: The Deconstruction Network 2020\",\n","              x = \"Age\", y = \"RFDS Score\")+\n","space_leg+\n","grid_x_light+\n","grid_y_light+\n","colors_2_point"]},{"cell_type":"markdown","id":"dacfab4a","metadata":{"papermill":{"duration":0.056057,"end_time":"2022-09-16T12:38:12.371431","exception":false,"start_time":"2022-09-16T12:38:12.315374","status":"completed"},"tags":[]},"source":["### RFDS & Age Observations\n","**Finding 5: Age does seem to correlate to higher RFDS scores.**\n","\n","One might have hypothesized that with increase in age you would see a higher RFDS score - assuming more time alive might be equated to more psychological development seems logical enough. However the opposite seems to be true.\n","\n","The two oldest age brackets both found 47% scoring 55 or more. While this was significantly higher than their peers in the control group it was still quite a bit lower than the other three age brackets. In fact, the highest scoring group by far was the under 18's group with 76% scoring 55 or more.\n","It seems that age is a good predictor of RFDS being higher, it could be possible this has more to do with generational changes than age specifically though.\n","\n","We will continue to look at RFDS scores and how they relate to our other questions throughout the rest of this study.\n"]},{"cell_type":"markdown","id":"70ac1604","metadata":{"papermill":{"duration":0.05482,"end_time":"2022-09-16T12:38:12.481778","exception":false,"start_time":"2022-09-16T12:38:12.426958","status":"completed"},"tags":[]},"source":["### RFDS by Country\n","We will have a look at how country impacts RFDS scores. For this we will filter out all countries that had less than 30 participants. \n","\n","This will leave us with: Australia, Canada, United Kingdom and United States"]},{"cell_type":"code","execution_count":32,"