l')\n","never_att <- c(72,24,10,15,20,4)\n","infreq_att <- c(24,43,38,54,40,14)\n","weekly_att <- c(4,33,53,31,39,82)\n","\n","church_att_reg_chr <- data.frame(church_denom, never_att, infreq_att, weekly_att)\n","colnames(church_att_reg_chr) <- c('church_denom','Never','Infrequently','At Least Weekly')\n","\n","church_att_reg_chr\n","\n","decon_att <- joined_final %>%\n","  select(everything()) %>% \n","  group_by(survey) %>%\n","  summarise('Never' = sum(church_att == '0')/n()*100,\n","            'Infrequently' = sum(church_att == '1' | church_att == '2' | church_att == '3')/n()*100,\n","           'At Least Weekly' = sum(church_att == '4' | church_att == '5')/n()*100,\n","            ) \n","\n","colnames(decon_att) <- c('church_denom','Never','Infrequently','At Least Weekly')\n","\n","church_att_reg_chr <- bind_rows(church_att_reg_chr, decon_att)\n","\n","all_denom_att <- church_att_reg_chr %>%\n","pivot_longer(cols=c('Never', \n","                      'Infrequently', \n","                      'At Least Weekly'),\n","                    names_to='attend_lvl',\n","                    values_to='percent')\n","\n","all_denom_attdata <- factor(all_denom_att, levels=c('Never', \n","                      'Infrequently', \n","                      'At Least Weekly'))\n","all_denom_att\n","all_denom_order <- c('Unaffiliated','Deconstructing','Orthodox','Mainline','Catholic','Hist Black','Control','Evangelical')\n","att_orders <- c('Never', \n","                      'Infrequently', \n","                      'At Least Weekly')\n","att_legend <- scale_fill_manual(labels = c('Never', 'Infrequent', 'At Least Weekly'))"]},{"cell_type":"code","execution_count":37,"id":"fdf08bff","metadata":{"execution":{"iopub.execute_input":"2022-09-16T12:38:14.494169Z","iopub.status.busy":"2022-09-16T12:38:14.49262Z","iopub.status.idle":"2022-09-16T12:38:14.85882Z","shell.execute_reply":"2022-09-16T12:38:14.856193Z"},"papermill":{"duration":0.432419,"end_time":"2022-09-16T12:38:14.862713"