twice as likely to attend at least once a week as women.**\n","\n","It appears that males are almost twice as likely (36%) to continue to attend church at least once a week during deconstruction when compared to females (18%).\n","\n","Females were around 26% more likely than males to both never attend church or attend infrequently.\n","\n","This could be due to all sorts of variables and needs further study. One theory is that with women rights and equality being common themes in many people’s deconstruction women have more reason to feel unable to continue in institutions that oppress them than men who are less affected by such systems of oppression. It must also be said that generally speaking women who question the system are much less likely to be heard out than men, again making the church a much more hostile place for a deconstructing female than a deconstructing male. More studies on this are being planned.\n"]},{"cell_type":"markdown","id":"24551640","metadata":{"papermill":{"duration":0.0645,"end_time":"2022-09-16T12:38:16.051939","exception":false,"start_time":"2022-09-16T12:38:15.987439","status":"completed"},"tags":[]},"source":["### Church Attendance by Age"]},{"cell_type":"code","execution_count":40,"id":"d1740d59","metadata":{"execution":{"iopub.execute_input":"2022-09-16T12:38:16.179699Z","iopub.status.busy":"2022-09-16T12:38:16.178117Z","iopub.status.idle":"2022-09-16T12:38:16.239187Z","shell.execute_reply":"2022-09-16T12:38:16.237291Z"},"papermill":{"duration":0.12683,"end_time":"2022-09-16T12:38:16.241732","exception":false,"start_time":"2022-09-16T12:38:16.114902","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 15 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>age_group</th><th scope=col>attend_lvl</th><th scope=col>percent</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><