gs":[]},"source":["**Finding 8: Ages 18 - 49 yrs old were less likely to attend church weekly when compared to other ages. The highest scoring age brackets being <18 & 65+ in both groups 46% attended at least once a week.**\n","\n","Age is often cited as a factor in deconstruction, a common theme being that those in the 18-29 years bracket are most likely to deconstruct.\n","\n","However the 18-29yr old group were less likely to never attend church than those who were in the next two age brackets spanning 30-64 yrs of age. In fact, they were also more likely to attend church at least once a week than their 30-49yr old counterparts.\n","\n","There is a large uptick in those under 18 and 65 and over who both scored 46% for attending church at least once a week. There could be a myriad of reasons for each age bracket's frequent church attendance but a couple of reasons that might warrant further exploration are:\n","\n","1. In the case of those under 18 it is probably a reasonable assumption that this might be related to requirements of parents to attend church while still being 'a child under our roof.' (A common phrase heard by the author when working with teens who are deconstructing).\n","\n","2. In the case of those over 65 it is likely they have some measure of a sunk-cost fallacy with such huge social barriers to leaving that attendance is less of a pain than leaving.\n","\n","Age gaps in church attendance have sometimes been linked to higher education playing a part. This will be studied further in our next report but is a common belief and higher education has been shown to be present in those who are dechurched – (Packard, Hope 2015)\n","\n","One thing is for sure, with 24% of 18-29yr old deconstructing Christians attending church at least once a week we can safely say that while many deconstructing Christians have dechurched a good quarter or so in this age bracket are still attending.\n"]},{"cell_type":"markdown","id":"208277e1","metadata":{"papermill":{"duration":0.064551,"end_time":"2022-09-16T12:38:17.100719","exception":false,"start_time":"2022-09-16T12:38:17.036168","status":"completed"},"tags":[]},"source":["### Church Attendance by Country"]},{"cell_type":"code","execution_count":42,"id":"3e406149","metadata":{"execution":{"iopub.execute_input":"2022-09-16T12:38:17.250258Z","iopub.status.busy":"2022-09-16T12:38:17.248623Z","iopub.status.idle":"2022-09-16T12:38:17.324678Z","shell.execute_reply":"2022-09-16T12:38:17.321994Z"},"papermill":{"duration":0.151868,"end_time":"2022-09-16T12:38:17.32773","exception":false,"start_time":"2022-09-16T12:38:17.175862","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 12 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>country</th><th scope=col>attend_lvl</th><th scope=col>percent</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>Australia     </td><td>Never          </td><td>42.10526</td></tr>\n","\t<tr><td>Australia     </td><td>Infrequently   </td><td>26.31579</td></tr>\n","\t<tr><td>Australia     </td><td>At Least Weekly</td><td>31.57895</td></tr>\n","\t<tr><td>Canada        </td><td>Never          </td><td>47.42268</td></tr>\n","\t<tr><td>Canada        </td><td>Infrequently   </td><td>39.17526</td></tr>\n","\t<tr><td>Canada        </td><td>At Least Weekly</td><td>13.40206</td></tr>\n","\t<tr><td>United Kingdom</td><td>Never          </td><td>21.42857</td></tr>\n","\t<tr><td>United Kingdom</td><td>Infrequently   </td><td>36.73469</td></tr>\n","\t<tr><td>United Kingdom</td><td>At Least Weekly</td><td>41.83673</td></tr>\n","\t<tr><td>United States </td><td>Never          </td><td>41.92708</td></tr>\n","\t<tr><td>United States </td><td>Infrequently   </td><td>36.84896</td></tr>\n","\t<tr><td>United States </td><td>At Least Weekly</td><td>21.22396</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A ti