as in the UK it has long been a majority non-religious country. Perhaps this has caused the church in the UK to adapt somewhat and be more welcoming of those who deconstruct. \n","\n","This could prove significant especially for religious leaders in the other countries who might be able to change something and maintain much higher attendance. We will look into this further in a later study."]},{"cell_type":"markdown","id":"8bb94933","metadata":{"papermill":{"duration":0.064632,"end_time":"2022-09-16T12:38:18.231886","exception":false,"start_time":"2022-09-16T12:38:18.167254","status":"completed"},"tags":[]},"source":["### Church attendance by RFDS Score"]},{"cell_type":"code","execution_count":44,"id":"7b97e7f5","metadata":{"execution":{"iopub.execute_input":"2022-09-16T12:38:18.364553Z","iopub.status.busy":"2022-09-16T12:38:18.363029Z","iopub.status.idle":"2022-09-16T12:38:18.413709Z","shell.execute_reply":"2022-09-16T12:38:18.411462Z"},"papermill":{"duration":0.120354,"end_time":"2022-09-16T12:38:18.416645","exception":false,"start_time":"2022-09-16T12:38:18.296291","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 12 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>rfds_group</th><th scope=col>attend_lvl</th><th scope=col>percent</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td><span style=white-space:pre-wrap>RFDS &lt;49  </span></td><td><span style=white-space:pre-wrap>Never          </span></td><td>24.54545</td></tr>\n","\t<tr><td><span style=white-space:pre-wrap>RFDS &lt;49  </span></td><td><span style=white-space:pre-wrap>Infrequently   </span></td><td>34.54545</td></tr>\n","\t<tr><td><span style=white-space:pre-wrap>RFDS &lt;49  </span></td><td>At Least Weekly</td><td>40.90909</td></tr>\n","\t<tr><td>RFDS 49-54</td><td>Never          </td><td>33.75315</td></tr>\n","\t<tr><td>RFDS 49-54