endance when compared to RFDS scores we can see a clear direction in the results. With the highest scoring group being over twice as likely to never attend church compared to the lowest scoring group. The lowest scoring group are around 2.7x as likely to attend at least once a week when compared to the highest group.\n","\n","From this we can see a very clear link between faith development and church attendance. If, and as it stands it is still an if, RFDS can be linked to Deconstruction this could suggest that continued church attendance among this group might be due to deconstruction being at an early stage of development and continued deconstruction may be more likely to result in leaving the church. More research will have to be conducted to see if RFDS can be linked to depth of deconstruction.\n"]},{"cell_type":"markdown","id":"0e81be19","metadata":{"papermill":{"duration":0.065909,"end_time":"2022-09-16T12:38:19.163821","exception":false,"start_time":"2022-09-16T12:38:19.097912","status":"completed"},"tags":[]},"source":["## Exploring the deconstructing group's comfort levels in church\n","One of our theories going into this initial study was that there would be a strong link between deconstruction and how comfortable people felt at church. A common thing cited by those who deconstruct is that they no longer feel comfortable in their own communities.\n","\n","In the following charts we will also create a simplified dataframe - This scale will be based on how an \"insider\" might feel about the responses... ie. what would a leader in these religious organisations see how the person felt in their church as positive or negative outcome. In this we assume that someone feeling neutral about their comfort levels would not be positive for a healthy organisation who are trying to make people feel comfortable."]},{"cell_type":"code","execution_count":46,"id":"624ddfd9","metadata":{"execution":{"iopub.execute_input":"2022-09-16T12:38:19.298944Z","iopub.status.busy":"202