ble or neutral) the difference is stark. With 87% giving a positive response in the content Christian category and only 22% of deconstructing/ed Christians giving a positive response.\n","\n","Again however this is quite different than many might have supposed. Yet again, we find just over a fifth of our group seeming to be defying common assumptions of this group by claiming to be comfortable in church.\n","\n","We look forward to studying further why it is that deconstructing Christians feel so uncomfortable in church.\n"]},{"cell_type":"markdown","id":"81e364db","metadata":{"papermill":{"duration":0.074103,"end_time":"2022-09-16T12:38:20.442136","exception":false,"start_time":"2022-09-16T12:38:20.368033","status":"completed"},"tags":[]},"source":["### Church comfort levels and sex"]},{"cell_type":"code","execution_count":48,"id":"c0c4c54a","metadata":{"execution":{"iopub.execute_input":"2022-09-16T12:38:20.582533Z","iopub.status.busy":"2022-09-16T12:38:20.580996Z","iopub.status.idle":"2022-09-16T12:38:20.663991Z","shell.execute_reply":"2022-09-16T12:38:20.66224Z"},"papermill":{"duration":0.15542,"end_time":"2022-09-16T12:38:20.666388","exception":false,"start_time":"2022-09-16T12:38:20.510968","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 10 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>sex</th><th scope=col>comf_lvl</th><th scope=col>percent</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>Female</td><td>Very Uncomfortable    </td><td>34.371108</td></tr>\n","\t<tr><td>Female</td><td>Somewhat Uncomfortable</td><td>37.858032</td></tr>\n","\t<tr><td>Female</td><td>Neutral               </td><td> 8.094645</td></tr>\n","\t<tr><td>Female</td><td>Somewhat Comfortable  </td><td>14.072229</td></tr>\n","\t<tr><td>Female</td><td>Very Comfortable      </td><td> 5.230386</td></tr>\n","\t<tr><td>M