 <- deconst_df %>%\n","  select(everything()) %>%\n","  group_by(sex) %>%\n","  summarise('Very Uncomfortable' =sum(church_comf == '1', na.rm = T)/n()*100,\n","            'Somewhat Uncomfortable' = sum(church_comf == '2', na.rm = T)/n()*100,\n","            'Neutral' = sum(church_comf == '3', na.rm = T)/n()*100,\n","           'Somewhat Comfortable' = sum(church_comf == '4', na.rm = T)/n()*100,\n","            'Very Comfortable' = sum(church_comf == '5', na.rm = T)/n()*100\n","            ) %>% \n","  pivot_longer(cols=c('Very Uncomfortable', \n","                    'Somewhat Uncomfortable', \n","                    'Neutral', \n","                    'Somewhat Comfortable', \n","                    'Very Comfortable'),\n","                names_to='comf_lvl',\n","                values_to='percent')\n","\n","comf_sex_pct\n","\n","# Create simplified attendance/sex dataframe\n","\n","s_comf_sex_pct <- deconst_df %>%\n","  select(everything()) %>%\n","  group_by(sex) %>%\n","  summarise('Not Comfortable' =sum(church_comf == '1' | church_comf == '2' | church_comf == '3', na.rm = T)/n()*100,\n","           'Comfortable' = sum(church_comf == '4' | church_comf == '5', na.rm = T)/n()*100\n","            ) %>% \n","  pivot_longer(cols=c('Not Comfortable', \n","                      'Comfortable'),\n","                names_to='comf_lvl',\n","                values_to='percent')\n","\n","s_comf_sex_pct"]},{"cell_type":"code","execution_count":49,"id":"4add6631","metadata":{"execution":{"iopub.execute_input":"2022-09-16T12:38:20.807208Z","iopub.status.busy":"2022-09-16T12:38:20.80565Z","iopub.status.idle":"2022-09-16T12:38:21.498706Z","shell.execute_reply":"2022-09-16T12:38:21.496891Z"},"papermill":{"duration":0.766232,"end_time":"2022-09-16T12:38:21.500876","exception":false,"start_time":"2022-09-16T12:38:20.734644","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABpAAAAPACAIAAAC9963GAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd4AU5e