,"output_type":"display_data"}],"source":["ggplot(comf_rfds_pct, aes(percent, rfds_group, fill=factor(comf_lvl,comfort_order)))+\n","geom_col(width = 0.5,position='fill', color='#000000')+\n","tdn_theme+\n","labs(title = \"Deconstructing Christian's Comfort Levels in Church by RFDS Scores\",\n","caption = \"Data source: The Deconstruction Network 2020\",\n","x = \"\", y = \"\")+  \n","percent_x+\n","grid_x+\n","space_leg+\n","colors_5\n","\n","ggplot(s_comf_rfds_pct, aes(percent, rfds_group, fill=factor(comf_lvl,s_comfort_order)))+\n","geom_col(width = 0.5,position='fill', color='#000000')+\n","tdn_theme+\n","labs(title = \"Deconstructing Christian's Comfort Levels in Church by RFDS Simplified\",\n","caption = \"Data source: The Deconstruction Network 2020\",\n","x = \"\", y = \"\")+  \n","percent_x+\n","grid_x+\n","space_leg+\n","colors_2"]},{"cell_type":"markdown","id":"3e2a435d","metadata":{"papermill":{"duration":0.08231,"end_time":"2022-09-16T12:38:26.155436","exception":false,"start_time":"2022-09-16T12:38:26.073126","status":"completed"},"tags":[]},"source":["### Observations on comfort levels in church and RFDS Scores\n","**Finding 13: As RFDS Scores increased so did discomfort in church.**\n","\n","We can see a very clear direction again in the RFDS results. As we increase the score on the RFDS we can see a significant increase in discomfort at church services. With 88% of the higher scoring group reporting to either be uncomfortable or neutral in church. In contrast, in the lowest scoring group we can see 53% claiming to feel uncomfortable. It would seem that faith development is closely linked to people’s discomfort in churches. In fact the lowest RFDS group had a higher percentage of people feeling very comfortable in church than the other three groups combined!"]},{"cell_type":"markdown","id":"9251eda0","metadata":{"papermill":{"duration":0.080685,"end_time":"2022-09-16T12:38:26.316043","exception":false,"start_time":"2022-09-16T12:38:26.235358","status":"completed"},"tags":[]},"source":["## Exploring the deconstructing group's ability to be open about their beliefs in church\n"]},{"cell_type":"markdown","id":"351a8651","metadata":{"papermill":{"duration":0.080928,"end_time":"2022-09-16T12:38:26.476572","exception":false,"start_time":"2022-09-16T12:38:26.395644","status":"completed"},"tags":[]},"source":["A 2015 study by Packard and Hope on 1000 dechurched (a group that significantly overlaps with deconstructing/ed people) found that the vast majority of people who left their churches (many of whom were presumably deconstructing) cited their reasons as no longer feeling they were able to share their beliefs without fear of negative consequences."]},{"cell_type":"code","execution_count":56,"id":"5222e235","metadata":{"execution":{"iopub.execute_input":"2022-09-16T12:38:26.640402Z","iopub.status.busy":"2022-09-16T12:38:26.638742Z","iopub.status.idle":"2022-09-16T12:38:26.723591Z","shell.execute_reply":"2022-09-16T12:38:26.721928Z"},"papermill":{"duration":0.169884,"end_time":"2022-09-16T12:38:26.726095","exception":false,"start_time":"2022-09-16T12:38:26.556211","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 8 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>survey</th><th scope=col>open_lvl</th><th scope=col>percent</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>Control       </td><td>Completely Hide</td><td> 2.631579</td></tr>\n","\t<tr><td>Control       </td><td>Somewhat Hide  </td><td>13.157895</td></tr>\n","\t<tr><td>Control       </td><td>Somewhat Open  </td><td>26.315789</td></tr>\n","\t<tr><td>Control       </td><td>Completely Open</td><td>57.894737</td></tr>\n","\t<tr><td>Deconstructing</td><td>Completely Hide</td><td>25.342466</td></tr>\n","\t<tr><td>Deconstructing</td><td>Somewhat Hide  </td><td>47.859589</td></tr>\n","\t<tr><td