ored significantly higher in feeling they had to hide their beliefs than the lowest group, group 4 (70%), group 3 (81%) and group 2 (68%) compared to only 50% in the lowest group, group1. This does make sense since we know that a common score for those in conventional faith groups is around the low-mid 40's and our lowest of the 4 groups is for any score under 48."]},{"cell_type":"markdown","id":"351f7a6e","metadata":{"papermill":{"duration":0.089041,"end_time":"2022-09-16T12:38:33.354411","exception":false,"start_time":"2022-09-16T12:38:33.26537","status":"completed"},"tags":[]},"source":["## Exploring the deconstructing group's failure to find answers to it's questions of their faith tradition"]},{"cell_type":"code","execution_count":66,"id":"d673f1c0","metadata":{"execution":{"iopub.execute_input":"2022-09-16T12:38:33.535844Z","iopub.status.busy":"2022-09-16T12:38:33.534118Z","iopub.status.idle":"2022-09-16T12:38:33.625738Z","shell.execute_reply":"2022-09-16T12:38:33.623785Z"},"papermill":{"duration":0.184912,"end_time":"2022-09-16T12:38:33.628102","exception":false,"start_time":"2022-09-16T12:38:33.44319","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 8 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>survey</th><th scope=col>failed_lvl</th><th scope=col>percent</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>Control       </td><td>Very unlike me    </td><td>31.578947</td></tr>\n","\t<tr><td>Control       </td><td>Slightly unlike me</td><td>39.473684</td></tr>\n","\t<tr><td>Control       </td><td>Slightly like me  </td><td>18.421053</td></tr>\n","\t<tr><td>Control       </td><td>Very like me      </td><td>10.526316</td></tr>\n","\t<tr><td>Deconstructing</td><td>Very unlike me    </td><td> 2.311644</td></tr>\n","\t<tr><td>Deconstructing</td><td>Slightly unlike me</td><td> 2.825342</td></