ing or disagreeing. We find that nobody in the top scoring group disagreed with the statement in comparison to 15% in the lowest group. In fact with each increase in score of about 5 points we see those disagreeing with the statement roughly halving from 15% to 6% to 3% before hitting 0%.\n","\n","But when we break it down to differentiate between slight and strong agreement/disagreement the progression becomes even more clear.\n","\n","While we see a clear progression of 85%, 94%, 97%, 100% in agreement as we move up the RFDS scores groupings. The change in strong agreement is more stark progressing as 51%, 74%, 88%, 96%. Showing that as ones faith is developed you are much more likely to strongly identify with this process of questioning and failing to find answers within your faith tradition."]},{"cell_type":"markdown","id":"769cd739","metadata":{"papermill":{"duration":0.0971,"end_time":"2022-09-16T12:38:39.574021","exception":false,"start_time":"2022-09-16T12:38:39.476921","status":"completed"},"tags":[]},"source":["## Exploring the deconstructing group's need to change their core beliefs\n"]},{"cell_type":"code","execution_count":76,"id":"54e17c38","metadata":{"execution":{"iopub.execute_input":"2022-09-16T12:38:39.771583Z","iopub.status.busy":"2022-09-16T12:38:39.769948Z","iopub.status.idle":"2022-09-16T12:38:39.864916Z","shell.execute_reply":"2022-09-16T12:38:39.862753Z"},"papermill":{"duration":0.196752,"end_time":"2022-09-16T12:38:39.86738","exception":false,"start_time":"2022-09-16T12:38:39.670628","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 8 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>survey</th><th scope=col>letgo_lvl</th><th scope=col>percent</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>Control       </td><td>Very unlike me    </td><td>31.578947</td></tr>\n","\t<tr