onstructing Christians's Need to Change Core Beliefs by RFDS Score\",\n","caption = \"Data source: The Deconstruction Network 2020\",\n","x = \"\", y = \"\")+\n","percent_x+\n","grid_x+\n","space_leg+\n","colors_4"]},{"cell_type":"markdown","id":"476c08a4","metadata":{"papermill":{"duration":0.104146,"end_time":"2022-09-16T12:38:46.063306","exception":false,"start_time":"2022-09-16T12:38:45.95916","status":"completed"},"tags":[]},"source":["### Observations on need to change their core beliefs and RFDS Score\n","**Finding 22: Strong agreement with the statement progressed significantly with each increase in RFDS score as follows: 56%, 82%, 92%, 93%.**\n","\n","As we look at the RFDS scores we can again see there is a clear link between the score and the degree to which the participant was likely to agree with the statement.\n","\n","Here we see a progression of agreement with the statement of 87%, 95%, 97%, 99% going from lowest to highest scores.\n","\n","Again as with the prior question about questioning we find the most interesting progression across the scores in the difference between slight and strong agreement. We can see that the progression of strong agreement is 56%, 82%, 92%, 93%.\n","\n","This again seems to show that as the score increases participants are not just more likely to tick the criteria for deconstruction but to tick it more furiously."]},{"cell_type":"markdown","id":"db2ec69b","metadata":{"papermill":{"duration":0.105799,"end_time":"2022-09-16T12:38:46.272553","exception":false,"start_time":"2022-09-16T12:38:46.166754","status":"completed"},"tags":[]},"source":["# Conclusion\n","Having looked at all this data and some of its potential implications let’s look at what it means for our six initial questions we had going into the study.\n","\n","### What does current church attendance look like for those deconstructing?\n","\n","* Overall, 23% of deconstructing Christians claimed to attend church at least once a week, with 40% never attending and 37% attending infrequently.\n","\n","* 76% of the control group of ‘content Christians’ attended church at least once a week which was very similar to Evangelicals as expected.\n","\n","* Men were almost twice as likely to attend at least once a week as women.\n","\n","* There was a strong negative correlation between RFDS and church attendance, with the highest scoring group being twice as likely to never attend church compared to the lowest scoring group.\n","\n","* Ages 18 - 49 yrs old were less likely to attend church weekly when compared to other ages. The highest scoring age brackets being <18 & 65+ in both groups 46% attended at least once a week.\n","\n","\n","### How comfortable do they feel while attending church services?\n","\n","* 87% of content Christians claimed to be comfortable in church\n","\n","* Only 6% of deconstructing Christians felt very comfortable in church while 15% stated they felt slightly comfortable\n","\n","* Men were more likely than women to feel either comfortable (19 percentage points higher) or neutral (7 percentage points higher) when they last attended church.\n","\n","* All age groups reported feeling much more uncomfortable than comfortable in church but the oldest group did have the highest comfort score with 21% stating they felt very comfortable the last time they attended church.\n","\n","* As RFDS scores increased so did discomfort in church. \n","\n","\n","### How open about their beliefs are they able to be while attending church?\n","\n","* 84% of conventional content Christians claimed they could be open about their beliefs in church.\n","\n","* Only 25% of deconstructing Christians felt they could be open.\n","\n","* Age was strongly linked to ability to be open with each increase in age group resulting in a marked increase in comfort levels, 8% (<18yrs), 22% (18-29yrs), 24% (30-49yrs), 36% (50-64yrs), 56% (65yrs+).\n","\n","* Men were over all more likely to feel they could be open than women scoring 30% vs 25%. However when drilling down into the question we found that they were 3 times as likely to feel very comfortable as women were the last time they attended church.\n","\n","* As RFDS scores increased so did people's ability to feel open in church.\n","\n","### To what degree has their faith tradition failed to answer their questions, if indeed they had questions?\n","\n","* 95% of deconstructing Christians agreed with the statement, “I’ve questioned my faith tradition and it’s failed to provide satisfactory answers”\n","\n","* Only 29% of the control group could agree with the statement.\n","\n","* There were no significant links to sex and only minor observations to be made around age.\n","\n","* Strong agreement with the statement progressed significantly with each increase in RFDS score as follows: 51%, 74%, 88%, 96%.\n","\n","\n","### To what degree have they had had to change beliefs which they passionately held in the past?\n","\n","* 95% of deconstructing Christians agreed with the statement, “I’ve had to let go of things I passionately believed at earlier stages of my faith.”\n","\n","* Only 55% of the control group could agree with the statement.\n","\n","* There were no significant links to sex or age.\n","\n","* Strong agreement with the statement progressed significantly with each increase in RFDS score as follows: 56%, 82%, 92%, 93%.\n","\n","\n","### Could a measurement of Faith Development like Harris’s Revised Faith Development Scale (RFDS) score be a helpful tool in identifying deconstructing Christians?\n","\n","As is highlighted in the findings of this research, there is a consistent and strong correlation between RFDS scores and other key indicators of deconstruction.\n","\n","This seems to suggest that Deconstructing Christians have a more mature psychological framework than those who do not deconstruct.\n","\n","Whilst further research is required, these findings suggest that the RFDS could be an ideal tool to help identify deconstructing Christians."]},{"cell_type":"markdown","id":"7c4edbad","metadata":{"papermill":{"duration":0.104137,"end_time":"2022-09-16T12:38:46.480171","exception":false,"start_time":"2022-09-16T12:38:46.376034","status":"completed"},"tags":[]},"source":["# Moving Forward\n","Off the back of this study in particular there are several questions that have emerged. To me the biggest one is the difference between men and women’s experience of deconstructing and their church attendance. Women being much more likely to leave the church / feel comfortable could be hugely significant in a number of ways. It also highlights how important it will be in future studies to try and find people who do not identify within the male/female gender binary. These people are a very important group who would provide great insight into how gender roles might be playing into deconstruction for many people.\n","\n","More broadly speaking however, since we have significantly moved forward in identifying clear markers of deconstruction we need to continue to develop a profile of this group.\n","There are three main areas of questioning on my mind, looking forward:\n","\n","1. Who deconstructs? What kind of person ends up deconstructing? What were their beliefs before deconstructing? What were their actions? How involved in church were they? What caused the deconstruction to start? Etc.\n","\n","2. What does deconstruction look like? What do those who are deconstructing believe and do today? How similar are they? How are they different? What are common beliefs held? How does this process affect their wellbeing? Is there a general progression to deconstruction? Can we identify where people are on a linear journey or is every journey unique?\n"," \n","3. Where do those deconstructing end up? Is there a general end for those who deconstruct? Do all eventually leave the church? Do some return? Do most end up Atheist or Agnostic? Or maybe most retain their faith in Jesus? Or maybe, as I suspect, it’s not as simple as that and there is a very mixed spectrum.\n","\n","Looking over this initial study and its results I can say with great confidence we are going to be able to clear up a lot of misconceptions about those deconstructing. I’m very excited to be able to give them a voice. A voice backed up by data. And I’m hopeful that it might lead to more helpful and healthy conversations between those who are deconstructing and those who are not.\n"]},{"cell_type":"markdown","id":"bb238d03","metadata":{"papermill":{"duration":0.105211,"end_time":"2022-09-16T12:38:46.689124","exception":false,"start_time":"2022-09-16T12:38:46.583913","status":"completed"},"tags":[]},"source":["# Get involved\n","If you haven’t already joined our research panel and are deconstructing your faith please consider doing so. I fully believe we can make some profound discoveries and we need every voice we can get to make the data as well rounded and accurate as possible. You can join by clicking [here](https://www.thedeconstructionnetwork.com/research). It only requires 1 or 2 ten minute surveys a year."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":55.844895,"end_time":"2022-09-16T12:38:46.914067","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-09-16T12:37:51.069172","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}